// Get 
// name
// defaultValue
// choices => array | undefined 
$.urlParam = function(name, defaultValue,  choices){
  if(typeof defaultValue === 'undefined') defaultValue = '';
  if(typeof choices === 'undefined') choices = false;
  var keyValue = new RegExp('[\\?&]' + name + '=([^&]*)').exec(window.location.href);
  var value = keyValue && keyValue.length >  1 ? keyValue[1] : defaultValue;
  if(choices !== false) {
    if(choices.indexOf(value) < 0) {
      value = defaultValue;
    }
  }
  return value;
}

