function generateDay(f) {
  var y = document.getElementById('session_detail_'+f + '_1i').options[document.getElementById('session_detail_'+f + '_1i').selectedIndex].text;
  var m = document.getElementById('session_detail_'+f + '_2i').options[document.getElementById('session_detail_'+f + '_2i').selectedIndex].text;

  // 
  if (2 == m && (0 == y % 400 || (0 == y % 4 && 0 != y % 100))) {
    var last = 29;
  } else {
    var last = new Array(31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31)[m - 1];
  }

  // 
  // remember original value
  original = document.getElementById('session_detail_'+f + '_3i').value;
  obj = document.getElementById('session_detail_'+f + '_3i');
  obj.length = 0;

  //  
  for (var i = 0; i < last; i++) {
    obj.options[obj.length++] = new Option(i + 1, i + 1);
  }
  // put back original value
  // if original value doesn't exist, then alert and reset to 1
  if (original > last) {
    alert("That date doesn't exist for the month you selected. Please select a new date.");
    original = 1;
  }
  obj.value = original;
}
